  );

  const guestLinks = (
    <ul>
      <li>
        <Link to="/register">Inscription</Link>
      </li>
      <li>
        <Link to="/login">Connexion</Link>
      </li>
    </ul>
  );

  return (
    <nav className="navbar">
      <h1 className="brand">
        <Link to="/">TP1 App</Link>
